def board_remove_group(searchBoard, searchGroup):
	m = searchBoard[:]
	L = len(m[0])
	C = len(m)
	lZ = cZ = []
	for i in searchGroup:
		m[pos_l(i)][pos_c(i)] = get_no_color()
	mT = zip(*m) #transpose matrix
	for i in range(0,len(m)):
		if(m[i].count(get_no_color()) == L):
			cZ = cZ + [i]
	for i in range(0,len(mT)):
		if(mT[i].count(get_no_color()) == C):
			lZ = lZ + [i]
	for i in reversed(cZ):
		del m[i]
	for i in reversed(lZ):
		for row in m:
			del row[i]
	while (len(m) < C):
		m = [[0] * L] + m
	for i in range(0,len(m)):
		while (len(m[i]) < L):
			m[i] = m[i] + [0]
	return m


